script: |
  super -f text -I q9436.spq | sort > q9436.out

inputs:
  - name: q9436.spq
    data: |
      SELECT 86 / - ( + + col0 ) + - col2 / - col2 AS col0 FROM tab2 (FORMAT parquet) WHERE NULL NOT BETWEEN + - 95 * + col2 * + - 75 AND + col2 * + 5 + - 32;
  - name: tab2

outputs:
  - name: q9436.out
    data: |
